// React
import React from "react";
import { Link, useLocation } from "react-router-dom";

function Navbar({ showProcess }) {
  let location = useLocation();
  return (
    <div
      className="mobileHide"
      style={{
        position: "fixed",
        top: 0,
        left: 0,
        right: 0,
        height: "64px",
        background:
          "linear-gradient( 90deg, rgb(255 255 240) 0%, rgb(246 254 255) 100% )",
        display: "flex",
        justifyContent: "flex-start",
        zIndex: 101,
      }}
    >
      <div
        style={{
          width: "100%",
          display: "flex",
          alignItems: "center",
          justifyContent: "flex-start",
          gap: "32px",
          padding: "0px 32px",
        }}
        class="mobileStack mobileNav"
      >
        <Link
          style={{
            textDecoration: "none",
            fontWeight: 600,
            color: "black",
            fontSize: "18px",
            whiteSpace: "nowrap",
          }}
          to="/"
        >
          Sam Ticknor
        </Link>
        <div
          style={{
            width: "100%",
            display: "flex",
            alignItems: "center",
            justifyContent: "flex-start",
            gap: "32px",
          }}
          className="mobileGap"
        >
          <Link
            className={location.pathname === "/" ? "" : "clickable"}
            style={{
              textDecoration: "none",
              color: "black",
              fontWeight: location.pathname === "/" ? 600 : 500,
            }}
            to="/"
          >
            Works
          </Link>
          {showProcess && (
            <Link
              className={location.pathname === "/process" ? "" : "clickable"}
              style={{
                textDecoration: "none",
                color: "black",
                fontWeight: location.pathname === "/process" ? 600 : 500,
              }}
              to="/process"
            >
              Process
            </Link>
          )}
          <Link
            className={location.pathname === "/about" ? "" : "clickable"}
            style={{
              textDecoration: "none",
              color: "black",
              fontWeight: location.pathname === "/about" ? 600 : 500,
            }}
            to="/about"
          >
            About
          </Link>
          <Link
            className="clickable"
            style={{
              textDecoration: "none",
              color: "black",
              opacity: location.pathname === "/contact" ? 1 : 0.9,
              fontWeight: location.pathname === "/contact" ? 600 : 500,
            }}
            to="/contact"
          >
            Contact
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
